    false,nt"url": null,nt"notes": "The Julia Butler Hansen Refuge for the
    Columbian White-tailed Deer (JBH) is a varied and dynamic system, much of which
    is still changing from the effects of levee construction and agricultural practices.
    Land subsidence from levee construction has been occurring for nearly 100 years,
    pushing up relative groundwater levels and slowly altering vegetation and habitat.
    In addition, the area lies within the tidal regime of the Columbia River, and anticipated
    increases in sea-level rise are further expected to increase ground water levels.These
    changes added to the potential effects of climate change and normal habitat succession
    will affect wildlife populations over time. Slow changes such as those occurring
    on JBH are difficult to quantify without long-term monitoring. This survey is designed
    to develop an index of wildlife populations for a variety of the species that use
    the Refuge. In addition to developing a baseline inventory, changes in numbers will
    be tracked over time to assess trends in wildlife use. With enough data, it will
    be possible to correlate these trends with changes in the physical environment.",nt"owner_org":
